    false,nt"url": null,nt"notes": "To provide advance statistics for U.S.
    International Trade in Goods, domestic retail inventories, and domestic wholesale
    inventories.rnrnCOVERAGErnrnThe estimates in this report are based on data from
    the U.S. International Trade in Goods, the Monthly Retail Trade Survey, and the
    Monthly Wholesale Trade SurveyrnrnU.S. International Trade in Goods: The export
    statistics consist of goods valued at more than $2,500 per commodity shipped by
    individuals and organizations (including exporters, freight forwarders, and carriers)
    from the U.S. to other countries. The import statistics consist of goods valued
    at more than $2,000 per commodity shipped by individuals and organizations (including
    importers and customs brokers) into the U.S. from other countries. Estimates are
    made for low-value exports by country of destination, and based on bilateral trade
    patterns. For detailed information on coverage, go to the Guide to Foreign Trade
    Statistics.rnrnMonthly Wholesale Trade: Companies with employment that are primarily
    engaged in merchant wholesale trade in the U.S, as defined by the North American
    Industry Classification System (NAICS), excluding Manufacturers' Sales Branches
    and Offices. Also excluded are non-merchant wholesalers such as agents, brokers,
    and electronic markets.rnrnMonthly Retail Trade: Retail companies, as defined by
    the North American Industry Classification System (NAICS), with one or more establishments
    that sell merchandise and related services to final consumers.",nt"license_title":
